import React from 'react'


const post = ({data}) => (
    <div className='post'>
        <img src={data.img} alt="" />
        <span style={{fontSize: '12px'}}>{data.name}</span>
        <div className="detail">
            <span> {data.desc}</span>
        </div>
    </div>
);


export default post;
